16 With respect to foreign markets, approval procedures vary among countries and, in addition to the aforementioned risks, can involve additional product testing, administrative review periods and agreements with pricing authorities. Any delay in obtaining, or inability to obtain, applicable regulatory approvals could prevent us from commercializing our product candidates. Specifically, Carmell plans to submit for a CE Mark approval in the European Union, which may or may not be successful. The new Medical Devices Regulation (Regulation (EU) 2017/745) in the European Union (“EU MDR”) became applicable in the European Union on May 26, 2021 and may make approval times longer and standards more difficult to pass, given the new Regulation imposes more stringent requirements in respect of device safety and clinical evaluation. Any delay in obtaining, or inability to obtain, applicable regulatory approvals could prevent us from commercializing our product candidates, if approved. In addition, our Notified Body is experiencing significant EU MDR-related delays, which has significantly limited our ability to interact and work with our Notified Body. It is not known when these delays will be resolved, and this could significantly delay any potential EU CE Mark approvals.

Delays in the commencement of clinical trials could result in increased costs and delay our ability to pursue regulatory approval.
The commencement of clinical trials can be delayed for a variety of reasons, including delays in:
•obtaining regulatory clearance to commence a clinical trial;
•identifying, recruiting and training suitable clinical investigators; •reaching agreement on acceptable terms with prospective clinical research organizations, and trial sites, the terms of which can be subject to extensive negotiation, may be subject to modification from time to time and may vary significantly among different clinical research organizations and trial sites;

•obtaining sufficient quantities of a product candidate for use in clinical trials;
•obtaining an IRB or ethics committee approval to conduct a clinical trial at a prospective site; and
•identifying, recruiting and enrolling patients to participate in a clinical trial; retaining patients who have initiated a clinical trial but may withdraw due to adverse events from the therapy, insufficient efficacy, fatigue with the clinical trial process or other issues. Any delays in the commencement of clinical trials will delay our ability to pursue regulatory approval for our product candidates. In addition, many of the factors that cause, or lead to, a delay in the commencement of clinical trials may also ultimately lead to the denial of regulatory approval of a product candidate.

•failure to conduct the clinical trial in accordance with regulatory requirements or our clinical protocols;
•inspection of the clinical trial operations or clinical trial site by the FDA or other regulatory authorities resulting in the imposition of a clinical hold;
•stopping rules contained in the protocol;
•unforeseen safety issues or any determination that the clinical trial presents unacceptable health risks;
•lack of adequate funding to continue the clinical trial;
•changes in regulatory requirements; and/or
•advances in medicine and science. In addition, FDA may not agree that information submitted to our IND is sufficient to support our planned clinical development and may impose a clinical hold. The FDA may require us to conduct additional preclinical studies or make other changes, which could delay development of our product candidates. For example, for our BHA program, the FDA has indicated that we must resolve certain chemistry, manufacturing, and controls comments from the FDA prior to submitting protocols to initiate clinical studies intended to provide the primary evidence of effectiveness to support a marketing authorization. Our inability to resolve these comments from the FDA, or to provide the information needed to support initiation of pivotal trials, could impact our ability to advance our lead candidate

