Risks Related to our Common Stock
We expect the price of our Common Stock may be volatile and may fluctuate substantially.
The stock market in general and the market for cosmetics companies in particular, have experienced extreme volatility that has often been unrelated to the operating performance of particular companies. The market price for our Common Stock may be influenced by many factors, including:
•commercialization and sales of our products;
•the results of our efforts to discover, develop, acquire or in-license products or product candidates, if any;
•failure or discontinuation of any of our research programs;
•actual or anticipated results from, and any delays in, any future clinical validation, testing or clinical trials, as well as results of regulatory reviews relating to the approval of any product candidates we may choose to develop;
•the level of expenses related to any products or product candidates that we may choose to develop or clinical development programs we may choose to pursue;
•disputes or other developments relating to proprietary rights, including patents, litigation matters and our ability to obtain patent protection for our technologies;
•announcements by us or our competitors of significant acquisitions, strategic partnerships, joint ventures and capital commitments;
•additions or departures of key scientific or management personnel;
•variations in our financial results or those of companies that are perceived to be similar to us;
•new products, product candidates or new uses for existing products introduced or announced by our competitors, and the timing of these introductions or announcements;
•results of clinical validation, testing or clinical trials of products or product candidates of our competitors;
•general economic and market conditions and other factors that may be unrelated to our operating performance or the operating performance of our competitors, including changes in market valuations of similar companies;
•regulatory or legal developments in the United States and other countries;
•changes in the structure of healthcare payment systems;
•conditions or trends in the cosmetics industries;
•actual or anticipated changes in earnings estimates, development timelines or recommendations by securities analysts;
•announcement or expectation of additional financing efforts;
•sales of Common Stock by us or our stockholders in the future, as well as the overall trading volume of our Common Stock; and
•the other factors described in this “Risk Factors” section. In the past, following periods of volatility in companies’ stock prices, securities class-action litigation has often been instituted against such companies. Such litigation, if instituted against us, could result in substantial costs and diversion of management’s attention and resources, which could materially and adversely affect our business and financial condition.

